import React, { Component } from 'react';

const GridImage = (prop) => {
  
  const { imageUrl } = this.props;

  return(
    <div className="col-3">
      <img src={imageUrl} />
    </div>
  )
}

class Artwork extends Component {
  render() {
    return(
      <div className="artwork">
        This is the artwork section
      </div>
    );
  }
}

export default Artwork;
